  false,\n\t\"url\": null,\n\t\"notes\": \"These data are the characteristics of the
  individual snags (standing dead trees) found at 15 sample points with three 0.05-ha
  circular plot habitat samples taken in 2005 at sample points at Spears and Didion
  Ranches, Placer County, California. Twelve of the forty-five 0.05-ha circular plots
  contained snags. To be counted, snags had to be > 4\" dbh and > 9.8 ft tall and
  within the 12.6 m radius plot.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
